import React from "react";

//styles
import { Wrapper, 
    Content,
    Picture,
    AStore,
    Gplay,
    Textbox,
    Downloadable,
    Btn
} from './Form.styles.js';

import welcomePage from '../../images/welcomepage.jpg';
import g1 from '../../images/g1.png';
import g2 from '../../images/g2.png';



const handleSubmit = async (event)  => {

    // kolla med servern om användaruppg är ok
    console.log(event.target.form.value, "här")


    event.preventDefault();
}


const welcome = () => {
    return (
        <Wrapper>
            <Content >    
                <Textbox> 
                    <h1> Snabba och prisvärdiga resor! </h1>
                    <h2> Ladda ner appen idag </h2>
                    <Downloadable>
                        <AStore><img src={g2} alt="download Appstore" width="60%" height="60%" /></AStore>
                        <Gplay><img src={g1} alt="download google" width="60%" height="60%" /></Gplay>
                    </Downloadable>
                </Textbox>
                <Btn>
                <form onSubmit={handleSubmit} >
                    <input type="submit" value="Logga in"/>
                    <input type="submit" value="Registrera"/>
                </form>
                </Btn>
            </Content >
            <Picture><img src={welcomePage} alt="guy on scooter" width="100%" height="100%" /></Picture>
        </Wrapper>
    )
}

export default welcome;
